import React from 'react';
import ResumeDL from './pdf/Resume.pdf';
import './css/Resume.css';
import documentLogo from './assets/document_logo.png';

const Resume = ({ handleMinimizeComponent }) => {
  return (
    <div className="resume-container">
      <div className="resume-header">
        <div className="resume-title">
          <img src={documentLogo} alt="document icon" className="document-logo" />
          <h2>Resume</h2>
        </div>

 <div className="right-buttons">
        <button  className="minimize-button" onClick={() => handleMinimizeComponent("resume")}>
          _
        </button>

        <div className="resume-close">
          <a href="/computer">X</a>
        </div>
        </div>
        </div>      
      <a href={ResumeDL} className='resume-download-btn' download>
          Download Resume
        </a>
      <div className="resume-preview" >  
          <iframe src={ResumeDL} width="100%" height="200%"></iframe>      

      </div>
    </div>
  );
}

export default Resume;
